CREATE TABLE 'actors' (
	'uuid'  INTEGER NOT NULL,
	'id'	INTEGER NOT NULL,
	'name'	text NOT NULL,
	'gender'	TEXT,
	PRIMARY KEY('id')
);

CREATE TABLE 'companions' (
	'uuid'  INTEGER NOT NULL,
	'id'	INTEGER NOT NULL,
	'name'	TEXT,
	'actor'	INTEGER,
	PRIMARY KEY('id'),
	FOREIGN KEY('actor') REFERENCES 'actors'('id') ON DELETE RESTRICT ON UPDATE RESTRICT
);

CREATE TABLE 'directors' (
	'uuid'  INTEGER NOT NULL,
	'id'	INTEGER NOT NULL,
	'name'	text NOT NULL,
	PRIMARY KEY('id')
);

CREATE TABLE 'doctors' (
	'uuid'  INTEGER NOT NULL,	
	'id'	INTEGER NOT NULL,
	'incarnation'	text NOT NULL,
	'primary_actor'	int ( 11 ) NOT NULL,
	PRIMARY KEY('id'),
	FOREIGN KEY('primary_actor') REFERENCES 'actors'('id') ON DELETE RESTRICT ON UPDATE RESTRICT
);

CREATE TABLE 'episodes' (
	'id'	INTEGER NOT NULL PRIMARY KEY,
	'title'	TEXT NOT NULL,
	'serial_id'	INTEGER NOT NULL,
	'story'	TEXT,
	'episode_order'	TEXT NOT NULL,
	'original_air_date'	TEXT NOT NULL,
	'runtime'	TEXT,
	'uk_viewers_mm'	NUMERIC,
	'appreciation_index'	INTEGER,
	'missing'	INTEGER DEFAULT 0,
	'recreated'	INTEGER DEFAULT 0
);

CREATE TABLE 'seasons' (
	'uuid'  INTEGER NOT NULL,
	'id'	INTEGER NOT NULL,
	'name'	text NOT NULL,
	PRIMARY KEY('id')
);

CREATE TABLE 'serials' (
	'id'	INTEGER NOT NULL,
	'season_id'	INTEGER NOT NULL,
	'story'	text,
	'serial'	INTEGER DEFAULT NULL,
	'title'	text NOT NULL,
	'production_code'	text,
	PRIMARY KEY('id')
);

CREATE TABLE 'writers' (
	'uuid'  INTEGER NOT NULL,	
	'id'	INTEGER NOT NULL,
	'name'	text NOT NULL,
	PRIMARY KEY('id')
);

CREATE TABLE 'serials_companions' (
	'serial_id'	INTEGER NOT NULL,
	'companion_id' INTEGER NOT NULL,
	FOREIGN KEY('companion_id') REFERENCES 'companions'('id') ON DELETE RESTRICT ON UPDATE RESTRICT,
	PRIMARY KEY('serial_id','companion_id'),
	FOREIGN KEY('serial_id') REFERENCES 'serials'('id') ON DELETE RESTRICT ON UPDATE RESTRICT
);

CREATE TABLE 'serials_directors' (
	'serial_id'	INTEGER NOT NULL,
	'director_id' INTEGER NOT NULL,
	PRIMARY KEY('serial_id','director_id'),
	FOREIGN KEY('serial_id') REFERENCES 'serials'('id') ON DELETE RESTRICT ON UPDATE RESTRICT,
	FOREIGN KEY('director_id') REFERENCES 'directors'('id') ON DELETE RESTRICT ON UPDATE RESTRICT
);

CREATE TABLE 'serials_doctors' (
	'serial_id'	INTEGER NOT NULL,
	'doctor_id'	INTEGER NOT NULL,
	FOREIGN KEY('serial_id') REFERENCES 'serials'('id') ON DELETE RESTRICT ON UPDATE RESTRICT,
	PRIMARY KEY('serial_id','doctor_id'),
	FOREIGN KEY('doctor_id') REFERENCES 'doctors'('id') ON DELETE RESTRICT ON UPDATE RESTRICT
);

CREATE TABLE 'serials_writers' (
	'serial_id'	INTEGER NOT NULL,
	'writer_id'	INTEGER NOT NULL,
	FOREIGN KEY('serial_id') REFERENCES 'serials'('id') ON DELETE RESTRICT ON UPDATE RESTRICT,
	FOREIGN KEY('writer_id') REFERENCES 'writers'('id') ON DELETE RESTRICT ON UPDATE RESTRICT,
	PRIMARY KEY('serial_id','writer_id')
);














